// List of items with their images, names, and prices
const items = [
   { name: "Margherita Pizza", price: 250, image: "data:image/jpeg;base64," },
    { name: "Veg Biryani", price: 150, image: "data:image/jpeg;base64," },
    { name: "Chicken Biryani", price: 200, image: "data:image/jpeg;base64," },
    { name: "Pasta Alfredo", price: 180, image: "data:image/jpeg;base64," },
    { name: "Paneer Butter Masala", price: 220, image: "data:image/jpeg;base64," },
    { name: "Butter Chicken", price: 300, image: "data:image/jpeg;base64," },
    { name: "Cheese Burger", price: 120, image: "data:image/jpeg;base64," },
    { name: "Chole Bhature", price: 100, image: "data:image/jpeg;base64," },
    { name: "Dosa", price: 80, image: "data:image/jpeg;base64," },
    { name: "Pav Bhaji", price: 90, image: "data:image/jpeg;base64," },
    { name: "Tandoori Chicken", price: 350, image: "data:image/jpeg;base64," },
    { name: "Momos", price: 70, image: "data:image/jpeg;base64," },
    { name: "Fried Rice", price: 150, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSREAi8wo-e49nUoJAfeCvl6aEnoN_3m_xu4A&s" },
    { name: "Spring Roll", price: 50, image: "data:image/jpeg;base64," },
    { name: "Pani Puri", price: 40, image: "data:image/jpeg;base64," },
    { name: "Samosa", price: 20, image: "data:image/jpeg;base64," },
    { name: "Masala Dosa", price: 90, image: "data:image/jpeg;base64," },
    { name: "Chocolate Cake", price: 150, image: "data:image/jpeg;base64," },
    { name: "Cold Coffee", price: 120, image: "data:image/jpeg;base64," },
    { name: "French Fries", price: 80, image: "data:image/jpeg;base64," },
];

// Cart array to hold the items added by the user (with quantities)
let cartItems = [];

// Select elements
const menuItemsContainer = document.getElementById('menuItems');
const cartList = document.getElementById('cartItems');
const totalPriceElement = document.getElementById('totalPrice');
const orderButton = document.getElementById('orderButton');
const orderForm = document.getElementById('orderForm');
const billSummary = document.getElementById('billSummary');
const billItems = document.getElementById('billItems');
const billTotalPrice = document.getElementById('billTotalPrice');
const billAddress = document.getElementById('billAddress');
const billMobile = document.getElementById('billMobile');

// Function to display the items
function displayMenuItems() {
    items.forEach((item, index) => {
        const itemDiv = document.createElement('div');
        itemDiv.classList.add('menu-item');
        itemDiv.innerHTML = `
            <img src="${item.image}" alt="${item.name}">
            <h3>${item.name}</h3>
            <p>₹${item.price}</p>
            <button onclick="addToCart(${index})">ADD TO CART</button>
        `;
        menuItemsContainer.appendChild(itemDiv);
    });
}

// Function to display the cart items
function displayCartItems() {
    cartList.innerHTML = ''; // Clear the cart before displaying
    cartItems.forEach((cartItem, index) => {
        const li = document.createElement('li');
        li.innerText = `${cartItem.name} (x${cartItem.quantity}) - ₹${cartItem.price * cartItem.quantity}`;
        
        const removeButton = document.createElement('button');
        removeButton.innerText = "Remove";
        removeButton.style.marginLeft = '10px';
        removeButton.addEventListener('click', () => {
            removeCartItem(index);
        });

        li.appendChild(removeButton);
        cartList.appendChild(li);
    });

    // Update the total price
    updateTotalPrice();

    // Show or hide the order button
    orderButton.classList.toggle('hidden', cartItems.length === 0);
}

// Function to add an item to the cart (only once, increases quantity if added again)
function addToCart(index) {
    const existingItemIndex = cartItems.findIndex(item => item.name === items[index].name);

    if (existingItemIndex > -1) {
        // If item already in cart, increase its quantity
        cartItems[existingItemIndex].quantity++;
    } else {
        // If item not in cart, add it with quantity 1
        cartItems.push({
            name: items[index].name,
            price: items[index].price,
            quantity: 1
        });
    }

    displayCartItems();
}

// Function to remove an item from the cart
function removeCartItem(index) {
    cartItems.splice(index, 1); // Remove the item at the given index
    displayCartItems(); // Update the display
}

// Function to calculate and display the total price
function updateTotalPrice() {
    const total = cartItems.reduce((sum, item) => sum + item.price * item.quantity, 0);
    totalPriceElement.innerText = `Total: ₹${total}`;
}

// Show order form when "Place Order" button is clicked
orderButton.addEventListener('click', () => {
    orderForm.classList.remove('hidden');
});

// Handle order confirmation
const confirmOrderButton = document.getElementById('confirmOrderButton');
confirmOrderButton.addEventListener('click', () => {
    const address = document.getElementById('address').value;
    const mobile = document.getElementById('mobile').value;

    if (address && mobile) {
        displayBillSummary(address, mobile);
        orderForm.classList.add('hidden');
        billSummary.classList.remove('hidden');
    } else {
        alert('Please enter both address and mobile number.');
    }
});

// Function to display the bill summary
function displayBillSummary(address, mobile) {
    billItems.innerHTML = ''; // Clear the bill list
    cartItems.forEach(item => {
        const li = document.createElement('li');
        li.innerText = `${item.name} (x${item.quantity}) - ₹${item.price * item.quantity}`;
        billItems.appendChild(li);
    });

    const total = cartItems.reduce((sum, item) => sum + item.price * item.quantity, 0);
    billTotalPrice.innerText = `Total: ₹${total}`;
    billAddress.innerText = address;
    billMobile.innerText = mobile;
}

// Initialize menu items on page load
displayMenuItems();

// Select the download bill button
const downloadBillButton = document.getElementById('downloadBillButton');

// Function to download the bill
downloadBillButton.addEventListener('click', () => {
    // Generate the bill content as a string
    let billContent = "Order Summary\n\n";
    cartItems.forEach(item => {
        billContent += `${item.name} (x${item.quantity}) - ₹${item.price * item.quantity}\n`;
    });
    
    const total = cartItems.reduce((sum, item) => sum + item.price * item.quantity, 0);
    billContent += `\nTotal: ₹${total}\n`;
    billContent += `Address: ${billAddress.innerText}\n`;
    billContent += `Mobile: ${billMobile.innerText}\n`;
    billContent += "\nThank you for your order!";

    // Create a Blob from the string data
    const blob = new Blob([billContent], { type: 'text/plain' });
    
    // Create a temporary link element to download the file
    const link = document.createElement('a');
    link.href = URL.createObjectURL(blob);
    link.download = 'order_summary.txt'; // File name
    link.click(); // Programmatically click the link to trigger download
    
    // Clean up the URL object after download
    URL.revokeObjectURL(link.href);
});

// Initialize menu items on page load
displayMenuItems();
